import { GoogleMap, useLoadScript, Marker } from "@react-google-maps/api";

const containerStyle = {
  width: '100%',
  height: '400px'
};

const center = {
  lat: 7.89391,  // ejemplo: Buenos Aires
  lng: -72.50782
};

function Mapa() {
  const { isLoaded } = useLoadScript({
    googleMapsApiKey: 'AIzaSyDojbUyQ30EbzMwNRXKlFYxMQmqRtOw1Y0'
  });

  if (!isLoaded) return <div>Cargando mapa...</div>;

  return (
    <GoogleMap
      mapContainerStyle={containerStyle}
      center={center}
      zoom={12}
    >
      <Marker position={center} />
    </GoogleMap>
  );
}

export default Mapa;
